
(() => {
  const $ = (s, r=document) => r.querySelector(s);
  const $$ = (s, r=document) => Array.from(r.querySelectorAll(s));
  const clamp = (v, a, b) => Math.max(a, Math.min(b, v));

  const els = {
    svg: $("#cardSvg"),
    defs: $("#svgDefs"),
    bgRect: $("#bgRect"),
    patternLayer: $("#patternLayer"),
    logoImg: $("#logoImg"),
    msgGroup: $("#messageGroup"),
    msgText: $("#msgText"),
    signText: $("#signText"),
    stickersLayer: $("#stickersLayer"),

    toast: $("#toast"),

    msgPills: $("#msgPills"),
    fontSel: $("#fontSel"),
    fontSize: $("#fontSize"),
    fontSizeVal: $("#fontSizeVal"),
    signInput: $("#signInput"),
    themeRow: $("#themeRow"),
    bgA: $("#bgA"),
    bgB: $("#bgB"),
    patternPills: $("#patternPills"),
    stickerRow: $("#stickerRow"),
    btnSmaller: $("#btnSmaller"),
    btnBigger: $("#btnBigger"),
    btnDelete: $("#btnDelete"),
    btnExport: $("#btnExport"),
    btnReset: $("#btnReset"),
    btnShare: $("#btnShare"),
  };

  // === Data ===
  const LOGO_DATA_URI = "data:image/png;base64,";

  const MESSAGES = [
    "Que a magia do Natal ilumine seu caminho.",
    "Um Natal de paz, amor e bons encontros.",
    "Feliz Natal! Que seu corao se encha de alegria.",
    "Que no falte esperana para um novo ano incrvel.",
    "Boas festas! Carinho, gratido e muitos sorrisos."
  ];

  const FONTS = [
    { id:"Inter", label:"Inter", family:"Inter, system-ui, sans-serif" },
    { id:"Poppins", label:"Poppins", family:"Poppins, sans-serif" },
    { id:"Nunito", label:"Nunito", family:"Nunito, sans-serif" },
    { id:"Montserrat", label:"Montserrat", family:"Montserrat, sans-serif" },
    { id:"DMSans", label:"DM Sans", family:"\"DM Sans\", sans-serif" },
    { id:"Playfair", label:"Playfair Display", family:"\"Playfair Display\", serif" },
    { id:"Merriweather", label:"Merriweather", family:"Merriweather, serif" },
    { id:"Pacifico", label:"Pacifico", family:"Pacifico, cursive" },
    { id:"GreatVibes", label:"Great Vibes", family:"\"Great Vibes\", cursive" },
  ];

  const THEMES = [
    { id:"noite", name:"Noite", a:"#0b1220", b:"#0f2a4a", t:"#ffffff", pattern:"stars" },
    { id:"pinheiro", name:"Pinheiro", a:"#052e1a", b:"#14532d", t:"#f8fafc", pattern:"snow" },
    { id:"rubi", name:"Rubi", a:"#3b0a1a", b:"#b91c1c", t:"#fff7ed", pattern:"dots" },
    { id:"champagne", name:"Champagne", a:"#2b1f12", b:"#a16207", t:"#fff7ed", pattern:"waves" },
    { id:"aurora", name:"Aurora", a:"#0a1f2e", b:"#0f766e", t:"#e6fffb", pattern:"snow" },
    { id:"neve", name:"Neve", a:"#0b1220", b:"#334155", t:"#ffffff", pattern:"snow" },
  ];

  const PATTERNS = [
    { id:"none", name:"Sem" },
    { id:"snow", name:"Neve" },
    { id:"stars", name:"Estrelas" },
    { id:"dots", name:"Pontos" },
    { id:"waves", name:"Ondas" },
  ];

  const STICKERS = [
    { id:"star", name:"Estrela", svg: `
      <g>
        <path d="M24 2l6.2 12.6L44 17l-10 9.7L36.3 40 24 33.5 11.7 40 14 26.7 4 17l13.8-2.4L24 2z"
              fill="url(#gStar)"/>
        <defs>
          <linearGradient id="gStar" x1="0" y1="0" x2="1" y2="1">
            <stop offset="0" stop-color="#fde047"/><stop offset="1" stop-color="#fb7185"/>
          </linearGradient>
        </defs>
      </g>` },
    { id:"gift", name:"Presente", svg: `
      <g>
        <rect x="8" y="18" width="32" height="26" rx="6" fill="#60a5fa"/>
        <rect x="8" y="18" width="32" height="10" rx="6" fill="#2563eb" opacity=".9"/>
        <rect x="22" y="18" width="4" height="26" fill="#fbbf24"/>
        <path d="M20 18c-6 0-8-6-2-8 3-1 6 3 6 8h-4z" fill="#fb7185"/>
        <path d="M28 18c6 0 8-6 2-8-3-1-6 3-6 8h4z" fill="#f43f5e"/>
        <rect x="8" y="18" width="32" height="26" rx="6" fill="none" stroke="rgba(255,255,255,.55)" stroke-width="1.8"/>
      </g>` },
    { id:"candy", name:"Bengala", svg: `
      <g>
        <path d="M28 6c-7 0-12 5-12 12v14c0 5 4 9 9 9h3c5 0 9-4 9-9V18c0-2.2-1.8-4-4-4h-1"
          fill="#ffffff"/>
        <path d="M16 22h20" stroke="#fb7185" stroke-width="5" stroke-linecap="round"/>
        <path d="M16 32h20" stroke="#fb7185" stroke-width="5" stroke-linecap="round"/>
        <path d="M16 42h16" stroke="#fb7185" stroke-width="5" stroke-linecap="round"/>
        <path d="M28 6c-7 0-12 5-12 12" stroke="#e5e7eb" stroke-width="4" stroke-linecap="round"/>
      </g>` },
    { id:"bell", name:"Sino", svg: `
      <g>
        <path d="M24 6c-7 0-12 5.7-12 12.8V30l-3 4h30l-3-4V18.8C36 11.7 31 6 24 6z" fill="url(#gBell)"/>
        <defs>
          <linearGradient id="gBell" x1="0" y1="0" x2="1" y2="1">
            <stop offset="0" stop-color="#fbbf24"/><stop offset="1" stop-color="#f97316"/>
          </linearGradient>
        </defs>
        <circle cx="24" cy="36" r="4" fill="#f59e0b"/>
        <path d="M19 6c1-3 9-3 10 0" stroke="rgba(255,255,255,.55)" stroke-width="2" stroke-linecap="round"/>
      </g>` },
    { id:"holly", name:"Azevinho", svg: `
      <g>
        <path d="M18 28c-8-1-12-8-8-14 4 2 7 4 10 8 2-6 6-10 12-12 0 6-2 11-8 15 6 2 10 6 12 12-6 0-10-2-14-8-3 4-6 6-12 7z" fill="#22c55e"/>
        <circle cx="28" cy="26" r="4.2" fill="#ef4444"/>
        <circle cx="22" cy="30" r="3.7" fill="#f43f5e"/>
        <circle cx="28" cy="34" r="3.5" fill="#fb7185"/>
        <path d="M18 28c-8-1-12-8-8-14" stroke="rgba(0,0,0,.18)" stroke-width="2" fill="none"/>
      </g>` },
    { id:"heart", name:"Corao", svg: `
      <g>
        <path d="M24 42s-16-9.5-16-21c0-6.5 7.5-10 13-5 1.3 1.2 2.2 2.6 3 4 0.8-1.4 1.7-2.8 3-4 5.5-5 13-.5 13 5 0 11.5-16 21-16 21z"
          fill="url(#gHeart)"/>
        <defs>
          <linearGradient id="gHeart" x1="0" y1="0" x2="1" y2="1">
            <stop offset="0" stop-color="#fb7185"/><stop offset="1" stop-color="#ef4444"/>
          </linearGradient>
        </defs>
      </g>` },
    { id:"snow", name:"Floco", svg: `
      <g>
        <path d="M24 6v36" stroke="#e0f2fe" stroke-width="3" stroke-linecap="round"/>
        <path d="M12 12l24 24" stroke="#bae6fd" stroke-width="3" stroke-linecap="round"/>
        <path d="M36 12L12 36" stroke="#bae6fd" stroke-width="3" stroke-linecap="round"/>
        <circle cx="24" cy="24" r="4" fill="#e0f2fe"/>
      </g>` },
  ];

  const defaultState = () => ({
    msgIdx: 0,
    sign: "",
    fontId: "Inter",
    fontSize: 66,
    msgX: 540,
    msgY: 620,
    themeId: "noite",
    bgA: "#0b1220",
    bgB: "#0f2a4a",
    patternId: "stars",
    stickers: [],
    selectedKey: null,
  });

  let state = defaultState();

  // === Layout constants (must match index.html clipPath) ===
  const CLIP = { x: 80, y: 320, w: 920, h: 720, pad: 90 };

  function toast(text){
    els.toast.textContent = text || "";
    if (!text) return;
    clearTimeout(toast._t);
    toast._t = setTimeout(() => (els.toast.textContent = ""), 2200);
  }

  function b64EncodeUnicode(str){
    return btoa(unescape(encodeURIComponent(str)));
  }
  function b64DecodeUnicode(str){
    return decodeURIComponent(escape(atob(str)));
  }

  function saveHash(){
    const payload = {
      m: state.msgIdx, s: state.sign,
      f: state.fontId, fs: state.fontSize,
      mx: state.msgX, my: state.msgY,
      th: state.themeId, a: state.bgA, b: state.bgB,
      p: state.patternId,
      st: state.stickers
    };
    location.hash = b64EncodeUnicode(JSON.stringify(payload));
  }

  function loadHash(){
    if (!location.hash || location.hash.length < 2) return false;
    try{
      const obj = JSON.parse(b64DecodeUnicode(location.hash.slice(1)));
      if (typeof obj.m === "number") state.msgIdx = clamp(obj.m, 0, MESSAGES.length-1);
      if (typeof obj.s === "string") state.sign = obj.s.slice(0, 36);
      if (typeof obj.f === "string") state.fontId = obj.f;
      if (typeof obj.fs === "number") state.fontSize = clamp(obj.fs, 40, 96);
      if (typeof obj.mx === "number") state.msgX = clamp(obj.mx, CLIP.x + CLIP.pad, CLIP.x + CLIP.w - CLIP.pad);
      if (typeof obj.my === "number") state.msgY = clamp(obj.my, CLIP.y + CLIP.pad, CLIP.y + CLIP.h - CLIP.pad);
      if (typeof obj.th === "string") state.themeId = obj.th;
      if (typeof obj.a === "string") state.bgA = obj.a;
      if (typeof obj.b === "string") state.bgB = obj.b;
      if (typeof obj.p === "string") state.patternId = obj.p;

      if (Array.isArray(obj.st)){
        state.stickers = obj.st
          .filter(x => x && typeof x.key === "string" && typeof x.id === "string")
          .map(x => ({
            key: x.key,
            id: x.id,
            x: clamp(+x.x || 540, 80, 1000),
            y: clamp(+x.y || 900, 140, 1240),
            s: clamp(+x.s || 1, 0.45, 2.6),
            r: clamp(+x.r || 0, -35, 35),
          }));
      }
      return true;
    }catch(e){ return false; }
  }

  function svgClientToViewBox(clientX, clientY){
    const rect = els.svg.getBoundingClientRect();
    const vb = els.svg.viewBox.baseVal;
    const x = (clientX - rect.left) * (vb.width / rect.width) + vb.x;
    const y = (clientY - rect.top) * (vb.height / rect.height) + vb.y;
    return { x, y };
  }

  function ensureBgGradient(){
    let grad = $("#bgGrad", els.defs);
    if (!grad){
      grad = document.createElementNS("http://www.w3.org/2000/svg","linearGradient");
      grad.setAttribute("id","bgGrad");
      grad.setAttribute("x1","0"); grad.setAttribute("y1","0");
      grad.setAttribute("x2","1"); grad.setAttribute("y2","1");
      const s1 = document.createElementNS("http://www.w3.org/2000/svg","stop");
      s1.setAttribute("offset","0"); s1.setAttribute("id","bgStopA");
      const s2 = document.createElementNS("http://www.w3.org/2000/svg","stop");
      s2.setAttribute("offset","1"); s2.setAttribute("id","bgStopB");
      grad.appendChild(s1); grad.appendChild(s2);
      els.defs.appendChild(grad);
      els.bgRect.setAttribute("fill","url(#bgGrad)");
    }
    $("#bgStopA", els.defs).setAttribute("stop-color", state.bgA);
    $("#bgStopB", els.defs).setAttribute("stop-color", state.bgB);
  }

  function setPattern(id){
    els.patternLayer.innerHTML = "";
    if (id === "none") return;

    const g = document.createElementNS("http://www.w3.org/2000/svg","g");

    if (id === "dots"){
      for (let y=140; y<1350; y+=96){
        for (let x=80; x<1080; x+=96){
          const c = document.createElementNS("http://www.w3.org/2000/svg","circle");
          c.setAttribute("cx", x + (y%2 ? 26 : 0));
          c.setAttribute("cy", y);
          c.setAttribute("r", 3.2);
          c.setAttribute("fill", "rgba(255,255,255,.55)");
          g.appendChild(c);
        }
      }
    } else if (id === "stars"){
      const star = (x,y,r) => {
        const p = document.createElementNS("http://www.w3.org/2000/svg","path");
        const d = [
          `M ${x} ${y-r}`,
          `L ${x+r*0.28} ${y-r*0.28}`,
          `L ${x+r} ${y-r*0.18}`,
          `L ${x+r*0.36} ${y+r*0.20}`,
          `L ${x+r*0.58} ${y+r}`,
          `L ${x} ${y+r*0.52}`,
          `L ${x-r*0.58} ${y+r}`,
          `L ${x-r*0.36} ${y+r*0.20}`,
          `L ${x-r} ${y-r*0.18}`,
          `L ${x-r*0.28} ${y-r*0.28} Z`
        ].join(" ");
        p.setAttribute("d", d);
        p.setAttribute("fill", "rgba(255,255,255,.55)");
        return p;
      };
      for (let i=0;i<90;i++){
        const x = 60 + Math.random()*960;
        const y = 120 + Math.random()*1180;
        const r = 3 + Math.random()*6;
        g.appendChild(star(x,y,r));
      }
    } else if (id === "waves"){
      for (let y=170;y<1350;y+=110){
        const p = document.createElementNS("http://www.w3.org/2000/svg","path");
        const d = `M 0 ${y} C 180 ${y-30}, 360 ${y+30}, 540 ${y} S 900 ${y-30}, 1080 ${y}`;
        p.setAttribute("d", d);
        p.setAttribute("fill","none");
        p.setAttribute("stroke","rgba(255,255,255,.50)");
        p.setAttribute("stroke-width","4");
        p.setAttribute("stroke-linecap","round");
        p.setAttribute("opacity",".65");
        g.appendChild(p);
      }
    } else if (id === "snow"){
      for (let i=0;i<120;i++){
        const c = document.createElementNS("http://www.w3.org/2000/svg","circle");
        c.setAttribute("cx", 40 + Math.random()*1000);
        c.setAttribute("cy", 120 + Math.random()*1180);
        c.setAttribute("r", 1.6 + Math.random()*3.2);
        c.setAttribute("fill","rgba(255,255,255,.70)");
        g.appendChild(c);
      }
    }

    els.patternLayer.appendChild(g);
  }

  function themeTextColor(alpha=1){
    const th = THEMES.find(x => x.id === state.themeId);
    const base = (th && th.t) ? th.t : "#ffffff";
    const m = base.replace("#","").trim();
    const r = parseInt(m.slice(0,2),16);
    const g = parseInt(m.slice(2,4),16);
    const b = parseInt(m.slice(4,6),16);
    return `rgba(${r},${g},${b},${alpha})`;
  }

  function setTextStyle(){
    const f = FONTS.find(x => x.id === state.fontId) || FONTS[0];
    els.msgText.setAttribute("font-family", f.family);
    els.signText.setAttribute("font-family", f.family);
    els.msgText.setAttribute("fill", themeTextColor(1));
    els.signText.setAttribute("fill", themeTextColor(0.85));
  }

  function clearText(el){
    while (el.firstChild) el.removeChild(el.firstChild);
  }

  function wrapSvgText(el, text, maxWidth, lineHeight){
    clearText(el);
    const words = (text || "").split(/\s+/).filter(Boolean);
    if (!words.length) return;

    let line = [];
    let tspan = document.createElementNS("http://www.w3.org/2000/svg","tspan");
    tspan.setAttribute("x", state.msgX);
    tspan.setAttribute("dy", "0");
    el.appendChild(tspan);

    for (let i=0;i<words.length;i++){
      line.push(words[i]);
      tspan.textContent = line.join(" ");
      const len = tspan.getComputedTextLength ? tspan.getComputedTextLength() : 0;
      if (len > maxWidth && line.length > 1){
        line.pop();
        tspan.textContent = line.join(" ");
        line = [words[i]];
        tspan = document.createElementNS("http://www.w3.org/2000/svg","tspan");
        tspan.setAttribute("x", state.msgX);
        tspan.setAttribute("dy", String(lineHeight));
        tspan.textContent = words[i];
        el.appendChild(tspan);
      }
    }
  }

  function renderText(){
    const msg = MESSAGES[state.msgIdx];
    const fs = state.fontSize;

    els.msgText.setAttribute("font-size", String(fs));
    els.msgText.setAttribute("font-weight", "800");
    els.msgText.setAttribute("text-anchor","middle");
    els.msgText.setAttribute("dominant-baseline","middle");
    els.msgText.setAttribute("x", state.msgX);
    els.msgText.setAttribute("y", state.msgY);

    els.signText.setAttribute("font-size", String(Math.round(fs*0.44)));
    els.signText.setAttribute("font-weight", "700");
    els.signText.setAttribute("text-anchor","middle");
    els.signText.setAttribute("dominant-baseline","middle");

    const maxWidth = CLIP.w - (CLIP.pad * 2);
    const lineHeight = Math.round(fs * 1.10);
    wrapSvgText(els.msgText, msg, maxWidth, lineHeight);

    const tspans = $$("tspan", els.msgText);
    const lines = tspans.length || 1;
    const totalH = (lines-1)*lineHeight;
    els.msgText.setAttribute("y", state.msgY - totalH/2);
    tspans.forEach((t,i) => {
      t.setAttribute("x", state.msgX);
      if (i===0) t.setAttribute("dy","0");
      else t.setAttribute("dy", String(lineHeight));
    });

    const sign = (state.sign || "").trim();
    els.signText.textContent = sign ? sign : "";
    els.signText.setAttribute("x", state.msgX);
    els.signText.setAttribute("y", state.msgY + totalH/2 + Math.round(fs*0.95));
  }

  function uid(){
    return Math.random().toString(16).slice(2) + Date.now().toString(16).slice(2);
  }

  function stickerTransform(g, st){
    g.setAttribute("transform", `translate(${st.x} ${st.y}) rotate(${st.r}) scale(${st.s}) translate(-24 -24)`);
  }

  function renderStickers(){
    els.stickersLayer.innerHTML = "";
    state.stickers.forEach(st => {
      const base = STICKERS.find(x => x.id === st.id);
      if (!base) return;

      const g = document.createElementNS("http://www.w3.org/2000/svg","g");
      g.setAttribute("data-key", st.key);
      g.style.cursor = "grab";
      g.style.touchAction = "none";
      g.style.pointerEvents = "all";
      g.innerHTML = base.svg;

      if (state.selectedKey === st.key){
        const ring = document.createElementNS("http://www.w3.org/2000/svg","rect");
        ring.setAttribute("class","selectionRing");
        ring.setAttribute("x","-4"); ring.setAttribute("y","-4");
        ring.setAttribute("width","56"); ring.setAttribute("height","56");
        ring.setAttribute("rx","12"); ring.setAttribute("ry","12");
        ring.setAttribute("fill","none");
        ring.setAttribute("stroke","rgba(255,255,255,.75)");
        ring.setAttribute("stroke-width","3");
        ring.setAttribute("stroke-dasharray","8 7");
        ring.setAttribute("opacity",".95");
        g.appendChild(ring);
      }

      stickerTransform(g, st);
      g.addEventListener("pointerdown", (ev) => startDragSticker(ev, st.key));
      els.stickersLayer.appendChild(g);
    });
  }

  function addSticker(id){
    const st = { key: uid(), id, x: 540, y: 900, s: 1.2, r: (Math.random()*18 - 9) };
    state.stickers.push(st);
    state.selectedKey = st.key;
    renderStickers();
    saveHash();
  }

  function selectSticker(key){
    state.selectedKey = key;
    renderStickers();
  }

  function scaleSelected(delta){
    const key = state.selectedKey;
    if (!key) return;
    const st = state.stickers.find(s => s.key === key);
    if (!st) return;
    st.s = clamp(st.s + delta, 0.45, 2.6);
    renderStickers();
    saveHash();
  }

  function deleteSelected(){
    const key = state.selectedKey;
    if (!key) return;
    state.stickers = state.stickers.filter(s => s.key !== key);
    state.selectedKey = null;
    renderStickers();
    saveHash();
  }

  // Drag engine
  const drag = { mode:null, key:null, start:null, orig:null, pointerId:null };

  function startDragSticker(ev, key){
    ev.preventDefault();
    ev.stopPropagation();
    selectSticker(key);

    const st = state.stickers.find(s => s.key === key);
    if (!st) return;

    drag.mode = "sticker";
    drag.key = key;
    drag.pointerId = ev.pointerId;
    drag.start = svgClientToViewBox(ev.clientX, ev.clientY);
    drag.orig = { x: st.x, y: st.y };

    window.addEventListener("pointermove", onDragMove, { passive:false });
    window.addEventListener("pointerup", endDrag, { once:true });
    window.addEventListener("pointercancel", endDrag, { once:true });
    try{ ev.target.setPointerCapture && ev.target.setPointerCapture(ev.pointerId); }catch(_e){}
  }

  function startDragText(ev){
    ev.preventDefault();
    ev.stopPropagation();
    drag.mode = "text";
    drag.pointerId = ev.pointerId;
    drag.start = svgClientToViewBox(ev.clientX, ev.clientY);
    drag.orig = { x: state.msgX, y: state.msgY };

    window.addEventListener("pointermove", onDragMove, { passive:false });
    window.addEventListener("pointerup", endDrag, { once:true });
    window.addEventListener("pointercancel", endDrag, { once:true });
    try{ ev.target.setPointerCapture && ev.target.setPointerCapture(ev.pointerId); }catch(_e){}
  }

  function onDragMove(ev){
    if (!drag.mode) return;
    if (drag.pointerId != null && ev.pointerId !== drag.pointerId) return;
    ev.preventDefault();

    const p = svgClientToViewBox(ev.clientX, ev.clientY);
    const dx = p.x - drag.start.x;
    const dy = p.y - drag.start.y;

    if (drag.mode === "sticker"){
      const st = state.stickers.find(s => s.key === drag.key);
      if (!st) return;
      st.x = clamp(drag.orig.x + dx, 80, 1000);
      st.y = clamp(drag.orig.y + dy, 140, 1240);

      const g = els.stickersLayer.querySelector(`[data-key="${drag.key}"]`);
      if (g) stickerTransform(g, st);
    } else if (drag.mode === "text"){
      state.msgX = clamp(drag.orig.x + dx, CLIP.x + CLIP.pad, CLIP.x + CLIP.w - CLIP.pad);
      state.msgY = clamp(drag.orig.y + dy, CLIP.y + CLIP.pad, CLIP.y + CLIP.h - CLIP.pad);
      renderText();
    }
  }

  function endDrag(){
    window.removeEventListener("pointermove", onDragMove);
    drag.mode = null; drag.key = null; drag.pointerId = null;
    drag.start = null; drag.orig = null;
    saveHash();
  }

  // Export
  function svgToPngBlob(svgEl, scale=2){
    return new Promise((resolve, reject) => {
      const clone = svgEl.cloneNode(true);
      const img = clone.querySelector("#logoImg");
      if (img) img.setAttribute("href", LOGO_DATA_URI);

      // Remove UI-only selection rings from export
      clone.querySelectorAll(".selectionRing").forEach(n => n.remove());

      const xml = new XMLSerializer().serializeToString(clone);
      const blob = new Blob([xml], { type: "image/svg+xml;charset=utf-8" });
      const url = URL.createObjectURL(blob);

      const image = new Image();
      image.onload = () => {
        try{
          const canvas = document.createElement("canvas");
          canvas.width = 1080 * scale;
          canvas.height = 1350 * scale;
          const ctx = canvas.getContext("2d");
          ctx.drawImage(image, 0, 0, canvas.width, canvas.height);
          URL.revokeObjectURL(url);
          canvas.toBlob((png) => {
            if (!png) reject(new Error("Falha ao gerar PNG"));
            else resolve(png);
          }, "image/png", 0.92);
        }catch(e){ reject(e); }
      };
      image.onerror = (e) => { URL.revokeObjectURL(url); reject(e); };
      image.src = url;
    });
  }

  async function exportPng(download=true){
    try{
      toast("Gerando imagem");
      const blob = await svgToPngBlob(els.svg, 2);
      const fileName = "cartao-natal.png";

      if (download){
        const a = document.createElement("a");
        a.href = URL.createObjectURL(blob);
        a.download = fileName;
        document.body.appendChild(a);
        a.click();
        a.remove();
        setTimeout(() => URL.revokeObjectURL(a.href), 1500);
        toast("PNG baixado ");
      }
      return { blob, fileName };
    }catch(e){
      console.error(e);
      toast("No consegui gerar a imagem ");
      return null;
    }
  }

  async function shareImage(){
    const res = await exportPng(false);
    if (!res) return;

    const file = new File([res.blob], res.fileName, { type: "image/png" });
    if (navigator.canShare && navigator.canShare({ files:[file] }) && navigator.share){
      try{
        await navigator.share({ files:[file], title:"Carto Natalino" });
        toast("Compartilhado ");
        return;
      }catch(e){}
    }

    const a = document.createElement("a");
    a.href = URL.createObjectURL(res.blob);
    a.download = res.fileName;
    document.body.appendChild(a);
    a.click();
    a.remove();
    setTimeout(() => URL.revokeObjectURL(a.href), 1500);
    toast("Seu navegador baixou o PNG ");
  }

  // UI mounts
  function mountTabs(){
    const tabs = $$(".tab");
    tabs.forEach(btn => {
      btn.addEventListener("click", () => {
        tabs.forEach(t => t.classList.remove("is-active"));
        btn.classList.add("is-active");
        const id = btn.dataset.tab;
        $$(".tabPane").forEach(p => p.classList.toggle("is-active", p.dataset.pane === id));
      });
    });
  }

  function mountMessages(){
    els.msgPills.innerHTML = "";
    MESSAGES.forEach((m, idx) => {
      const b = document.createElement("button");
      b.type="button";
      b.className = "pill" + (idx===state.msgIdx ? " is-active" : "");
      b.textContent = "Opo " + (idx+1);
      b.title = m;
      b.addEventListener("click", () => {
        state.msgIdx = idx;
        $$(".pill", els.msgPills).forEach((x,i)=>x.classList.toggle("is-active", i===idx));
        renderText();
        saveHash();
      });
      els.msgPills.appendChild(b);
    });
  }

  function mountFonts(){
    els.fontSel.innerHTML = "";
    FONTS.forEach(f => {
      const opt = document.createElement("option");
      opt.value = f.id;
      opt.textContent = f.label;
      els.fontSel.appendChild(opt);
    });
    els.fontSel.value = state.fontId;
    els.fontSel.addEventListener("change", () => {
      state.fontId = els.fontSel.value;
      setTextStyle();
      renderText();
      saveHash();
    });
  }

  function mountFontSize(){
    els.fontSize.value = String(state.fontSize);
    els.fontSizeVal.textContent = String(state.fontSize);
    els.fontSize.addEventListener("input", () => {
      state.fontSize = clamp(+els.fontSize.value, 40, 96);
      els.fontSizeVal.textContent = String(state.fontSize);
      renderText();
    });
    els.fontSize.addEventListener("change", saveHash);
  }

  function mountSign(){
    els.signInput.value = state.sign;
    els.signInput.addEventListener("input", () => {
      state.sign = els.signInput.value.slice(0,36);
      renderText();
      saveHash();
    });
  }

  function mountThemes(){
    els.themeRow.innerHTML = "";
    THEMES.forEach(th => {
      const b = document.createElement("button");
      b.type="button";
      b.className = "themeBtn" + (th.id===state.themeId ? " is-active" : "");
      b.style.background = `linear-gradient(135deg, ${th.a}, ${th.b})`;
      const name = document.createElement("div");
      name.className = "themeBtn__name";
      name.textContent = th.name;
      b.appendChild(name);
      b.addEventListener("click", () => {
        state.themeId = th.id;
        state.bgA = th.a;
        state.bgB = th.b;
        state.patternId = th.pattern;
        $$(".themeBtn", els.themeRow).forEach(x => x.classList.toggle("is-active", x===b));
        els.bgA.value = state.bgA;
        els.bgB.value = state.bgB;
        $$(".pill", els.patternPills).forEach(p => p.classList.toggle("is-active", p.dataset.pid===state.patternId));
        applyTheme();
        saveHash();
      });
      els.themeRow.appendChild(b);
    });
  }

  function mountColors(){
    els.bgA.value = state.bgA;
    els.bgB.value = state.bgB;
    els.bgA.addEventListener("input", () => { state.bgA = els.bgA.value; applyTheme(); });
    els.bgB.addEventListener("input", () => { state.bgB = els.bgB.value; applyTheme(); });
    const commit = () => saveHash();
    els.bgA.addEventListener("change", commit);
    els.bgB.addEventListener("change", commit);
  }

  function mountPatterns(){
    els.patternPills.innerHTML = "";
    PATTERNS.forEach(p => {
      const b = document.createElement("button");
      b.type="button";
      b.className = "pill" + (p.id===state.patternId ? " is-active" : "");
      b.textContent = p.name;
      b.dataset.pid = p.id;
      b.addEventListener("click", () => {
        state.patternId = p.id;
        $$(".pill", els.patternPills).forEach(x => x.classList.toggle("is-active", x.dataset.pid===p.id));
        setPattern(p.id);
        saveHash();
      });
      els.patternPills.appendChild(b);
    });
  }

  function mountStickers(){
    els.stickerRow.innerHTML = "";
    STICKERS.forEach(s => {
      const b = document.createElement("button");
      b.type="button";
      b.className = "stickerBtn";
      b.title = s.name;

      const wrap = document.createElement("div");
      wrap.innerHTML = `<svg viewBox="0 0 48 48" xmlns="http://www.w3.org/2000/svg">${s.svg}</svg>`;
      b.appendChild(wrap.firstElementChild);
      b.addEventListener("click", () => addSticker(s.id));
      els.stickerRow.appendChild(b);
    });

    els.btnSmaller.addEventListener("click", () => scaleSelected(-0.12));
    els.btnBigger.addEventListener("click", () => scaleSelected(+0.12));
    els.btnDelete.addEventListener("click", deleteSelected);
  }

  function mountActions(){
    els.btnExport.addEventListener("click", () => exportPng(true));
    els.btnShare.addEventListener("click", shareImage);
    els.btnReset.addEventListener("click", () => {
      state = defaultState();
      applyAll();
      saveHash();
      toast("Resetado ");
    });
  }

  function applyLogo(){
    els.logoImg.setAttribute("href", LOGO_DATA_URI);
  }

  function applyTheme(){
    ensureBgGradient();
    setPattern(state.patternId);
    setTextStyle();
    renderText();
  }

  function applyAll(){
    applyLogo();
    applyTheme();

    // UI sync
    mountMessages();
    els.fontSel.value = state.fontId;
    els.fontSize.value = String(state.fontSize);
    els.fontSizeVal.textContent = String(state.fontSize);
    els.signInput.value = state.sign;
    els.bgA.value = state.bgA;
    els.bgB.value = state.bgB;
    $$(".pill", els.patternPills).forEach(p => p.classList.toggle("is-active", p.dataset.pid===state.patternId));
    renderStickers();
  }

  function init(){
    // basic checks
    if (!els.svg || !els.stickersLayer || !els.msgText) throw new Error("SVG no carregou corretamente.");

    mountTabs();
    mountFonts();
    mountFontSize();
    mountSign();
    mountThemes();
    mountColors();
    mountPatterns();
    mountStickers();
    mountActions();

    loadHash();
    applyAll();

    // make text draggable
    const enableTextDrag = (node) => {
      node.style.cursor = "grab";
      node.style.touchAction = "none";
      node.style.pointerEvents = "all";
      node.addEventListener("pointerdown", startDragText);
    };
    enableTextDrag(els.msgText);
    enableTextDrag(els.signText);

    // deselect on background tap
    els.svg.addEventListener("pointerdown", () => {
      if (state.selectedKey){
        state.selectedKey = null;
        renderStickers();
      }
    });

    toast("Pronto  Arraste enfeites e texto.");
  }

  try{ init(); }
  catch(e){
    console.error(e);
    alert("Erro ao iniciar o editor. Veja o console.");
  }
})();
